import  { Component } from 'react'
import Typography from "@material-ui/core/Typography";
export class ContactUs extends Component {
    render() {
        return (
            <div>
                <Typography variant="h4">
                    You dont need toimpor
                </Typography>
            </div>
        )
    }
}

export default ContactUs
